import React from "react";

type col = {
    colores:string[],
}



export default function CambioColorBackGround(props:col){


    let color:number = Math.floor(Math.random() * props.colores.length );



    const BackGround = {
        background:props.colores[color],
    }



    return(

        <main style = {BackGround}>
        {props.colores}
            <div style={{background : 'blue'}}>
               colores
            </div>



        </main>

    );


}
